import React from 'react';
import {Link} from 'react-router-dom';

const VehicleTerm = (props) => {
    return (
        <tr key={props.vehicle.registration}>
            <td>{props.vehicle.picture}</td>
            <td>{props.vehicle.name}</td>
            <td>{props.vehicle.category}</td>
            <td>{props.vehicle.author.name} {props.book.author.surname}</td>
            <td>{props.vehicle.author.country.name}</td>
            <td>
                <Link className={"btn btn-warning"} onClick={() => props.onEdit(props.vehicle.registration)}
                      to={`/vehicles/edit/${props.vehicle.id}`}>Edit</Link>
            </td>
            <td>
                <a title={"Delete"} className={"btn btn-danger"}
                   onClick={() => props.onDelete(props.vehicle.registration)}>Delete</a>
            </td>
        </tr>
    )
}

export default VehicleTerm;
